window.bookSummaryJSON = "<p>Discover the extraordinary debut that has got everyone talking.</p> <p>Mild-mannered headmaster, Thomas Senlin prefers his adventures to be safely contained within the pages of a book. So when he loses his new bride shortly after embarking on the honeymoon of their dreams, he is ill-prepared for the trouble that follows. </p> <p>To find her, Senlin must enter the Tower of Babel - a world of geniuses and tyrants, of menace and wonder, of unusual animals and mysterious machines. And if he hopes to ever see his wife again, he will have to do more than just survive...this quiet man of letters must become a man of action.</p>"; 
